import React from "react";

function ProgressBar(props) {
  const { timerState, findProgressPercent } = props;
  if (!timerState.stop) {
    return (
      <div className="progress" style={{ height: "20px" }}>
        <div
          className="progress-bar"
          role="progressbar"
          aria-valuemin="0"
          aria-valuemax="100"
          aria-valuenow={findProgressPercent}
          style={{ width: `${findProgressPercent}%` }}
        />
      </div>
    );
  } else {
    return null;
  }
}

export default ProgressBar;
